import styled from 'styled-components';

export const Header = styled.header`

  height: 740px;
  width: 1280px;
  `;

export const StyledHeaderImage = styled.img`
z-index: 0;
position: absolute;

`;

export const InfoAbout = styled.div`
position: absolute;
z-index: 1;
  width: 499px;
  height: 450px;
filter: blur(5px)

`;
